import api from './api';

export const getMonthlyRevenue = async (month, year) => {
    try {
        const response = await api.get(`/reports/revenue?month=${month}&year=${year}`);
        return response.data;
    } catch (error) {
        throw new Error('Error fetching monthly revenue report');
    }
};

export const getMembershipReport = async () => {
    try {
        const response = await api.get('/reports/membership');
        return response.data;
    } catch (error) {
        throw new Error('Error fetching membership report');
    }
};

export const getTrainerPerformance = async (trainerId) => {
    try {
        const response = await api.get(`/reports/trainer/${trainerId}`);
        return response.data;
    } catch (error) {
        throw new Error('Error fetching trainer performance report');
    }
};

const reportService = {
    getMonthlyRevenue,
    getMembershipReport,
    getTrainerPerformance
};

export default reportService;
